export const style = `
      ul {
        background: #333;
        color: #fff;
        display: flex;
        list-style: none;
      }

      ul li {
        font-size: 18px;
        margin-right: 20px;
      }

      ul li a {
        color: #fff;
        text-decoration: none;`
